	(3, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book.</p><p><img class="img-responsive" src="data:image/png;base64," data-filename="poster-f3.png" style="width: 780px; height: 514.799px;"><br></p><p></p><p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book.</p><p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book.</p>', 'data:image/png;base64,', '2018-01-27 13:53:53', '2018-01-27 13:53:53', 7, 'PHP, Fatfree, Bootstrap, Mysql', 1, 1, 1),
	(5, 'Ionic Framework: Mengambil Gambar Dari Gallery atau Kamera', 'Pada sebuah aplikasi mobile mengambil gambar dari gallery atau kamera merupakan fitur yang umumnya ada. Fitur ini biasanya disematkan pada modul update photo profile user atau modul yang berhubungan dengan upload gambar. Pada tulisan kali ini kita akan membahas bagaimana mengambil gambar dari gallery atau dari kamera.', '<p><span style="color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Pada sebuah aplikasi mobile mengambil gambar dari gallery atau kamera merupakan fitur yang umumnya ada. Fitur ini biasanya disematkan pada modul update photo profile user atau modul yang berhubungan dengan upload gambar. Pada tulisan kali ini kita akan membahas bagaimana mengambil gambar dari gallery atau dari kamera.</span></p><p><img class="img-responsive" src="data:image/png;base64," data-filename="contact_app.png" style="width: 788px; height: 715.346px;"><span style="color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br></span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Persiapan</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Untuk dapat mengikuti tutorial ini sebaiknya anda sudah mengikuti kelas tutorial tentang membuat aplikasi&nbsp;<a target="_blank" rel="nofollow" href="http://kelaskoding.com/detail/13" style="box-sizing: inherit; color: rgb(0, 0, 0); touch-action: manipulation;">Kontak List dengan Ionic dan PHP</a>&nbsp;(<span style="box-sizing: inherit; font-weight: bolder;"><a target="_blank" rel="nofollow" href="http://kelaskoding.com/detail/13" style="box-sizing: inherit; color: rgb(0, 0, 0); touch-action: manipulation;">Gratis</a></span>), agar anda mendapatkan basic pengetahuan dari code program yang sudah ada.&nbsp;</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Install Plugin</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Untuk mengakses Gallery dan Kamera kita membutuhkan 2 buah plugin dari ionic yaitu Camera, Image Picker. Kemudian untuk mengubah gambar menjadi string base64 kita butuh plugin base64.&nbsp;</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">1. Install Plugin Camera</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs shell" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> ionic cordova plugin add cordova-plugin-camera</span>\r\n<span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> npm install --save @ionic-native/camera</span></code></pre><p><span style="box-sizing: inherit; font-weight: bolder; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">2. Install Plugin Image Picker</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs shell" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> ionic cordova plugin add cordova-plugin-telerik-imagepicker --variable PHOTO_LIBRARY_USAGE_DESCRIPTION=<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">"your usage message"</span></span>\r\n<span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> npm install --save @ionic-native/image-picker</span></code></pre><p><span style="box-sizing: inherit; font-weight: bolder; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">3. Install Plugin Base64</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs shell" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> ionic cordova plugin add com-badrit-base64</span>\r\n<span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> npm install --save @ionic-native/base64</span></code></pre><p><span style="box-sizing: inherit; font-weight: bolder; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Edit file app.module.ts</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe 