c-native/camera\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { ImagePicker } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@ionic-native/image-picker\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { Base64 } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@ionic-native/base64\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { DomSanitizer } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@angular/platform-browser\'</span>;\r\n\r\n@IonicPage()\r\n@Component({\r\n  <span class="hljs-attr" style="box-sizing: inherit;">selector</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'page-add\'</span>,\r\n  <span class="hljs-attr" style="box-sizing: inherit;">templateUrl</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'add.html\'</span>,\r\n})\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">export</span> <span class="hljs-class" style="box-sizing: inherit;"><span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">class</span> <span class="hljs-title" style="box-sizing: inherit; color: rgb(136, 0, 0); font-weight: bold;">AddPage</span> </span>{\r\n\r\n  contact: Contact = <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">new</span> Contact();\r\n\r\n  <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">constructor</span>(public navCtrl: NavController, \r\n    public navParams: NavParams, privat