ass="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.actionSheetCtrl.create({\r\n      <span class="hljs-attr" style="box-sizing: inherit;">title</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Select Image Source\'</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">buttons</span>:[\r\n        {\r\n          <span class="hljs-attr" style="box-sizing: inherit;">text</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Choose from Gallery\'</span>,\r\n          <span class="hljs-attr" style="box-sizing: inherit;">handler</span>: <span class="hljs-function" style="box-sizing: inherit;"><span class="hljs-params" style="box-sizing: inherit;">()</span>=&gt;</span>{\r\n            <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.chooseFromGallery();\r\n          }\r\n        },\r\n        {\r\n          <span class="hljs-attr" style="box-sizing: inherit;">text</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Use Camera\'</span>,\r\n          <span class="hljs-attr" style="box-sizing: inherit;">handler</span>: <span class="hljs-function" style="box-sizing: inherit;"><span class="hljs-params" style="box-sizing: inherit;">()</span> =&gt;</span>{\r\n            <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.takePictureWithCamera();\r\n          }\r\n        },\r\n        {\r\n          <span class="hljs-attr" style="box-sizing: inherit;">text</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Cancel\'</span>,\r\n          <span class="hljs-attr" style="box-sizing: inherit;">role</span>: <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'cancel\'</span>\r\n        }\r\n      ]\r\n    });\r\n    actionSheet.present();\r\n  }\r\n\r\n  chooseFromGallery(){\r\n    <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">const</span> options = {\r\n      <span class="hljs-attr" style="box-sizing: inherit;">width</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">200</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">height</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">200</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">quality</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">80</span>\r\n    }\r\n    <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.imagePicker.getPictures(options).then(<span class="hljs-function" style="box-sizing: inherit;">(<span class="hljs-params" style="box-sizing: inherit;">results</span>)=&gt;</span>{\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">var</span> file = results[<span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">0</span>];\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.base64.encodeFile(file).then(<span class="hljs-function" style="box-sizing: inherit;"><span class="hljs-params" style="box-sizing: inherit;">base64String</span>=&gt;</span>{\r\n        <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.contact.photo = base64String;\r\n      },error=&gt;{\r\n        <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.msgHandler(<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Error\'</span>,error);\r\n      });\r\n    },error=&gt;{\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.msgHandler(<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Error\'</span>, error);\r\n    });\r\n  }\r\n\r\n  takePictureWithCamera(){\r\n    <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">const</span> options : CameraOptions = {\r\n      <span class="hljs-attr" style="box-sizing: inherit;">quality</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">80</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">targetHeight</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">200</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">targetWidth</span>: <span class="hljs-number" style="box-sizing: inherit; color: rgb(136, 0, 0);">200</span>,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">destinationType</span>: <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.camera.DestinationType.DATA_URL,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">encodingType</span>: <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.camera.EncodingType.PNG,\r\n      <span class="hljs-attr" style="box-sizing: inherit;">mediaType</span>: <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.camera.MediaType.PICTURE\r\n    }\r\n    <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.camera.getPicture(options).then(<span class="hljs-function" style="box-sizing: inherit;"><span class="hljs-params" style="box-sizing: inherit;">imageData</span> =&gt;</span>{\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">let</span> base64String = <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'data:image/png;base64,\'</span> + imageData;\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.contact.photo = base64String;\r\n    },error=&gt;{\r\n      <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>.msgHandler(<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Error\'</span>, error);\r\n    })\r\n  }\r\n\r\n  msgHandler(title: string, <span class="hljs-attr" style="box-sizing: inherit;">message</span>: string){\r\n    <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">const</span> alert = <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">this</span>\r\n    .alertCtrl\r\n    .create({<span class="hljs-attr" style="box-sizing: inherit;">title</span>: title, <span class="hljs-attr" style="box-sizing: inherit;">message</span>: message, <span class="hljs-attr" style="box-sizing: inherit;">buttons</span>: [<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Ok\'</span>]});\r\n    alert.present();\r\n  }\r\n}\r\n</code>\r\n</pre><p><span style="color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Pada kode file add.ts yang perlu diperhatikan adalah tambahan 3 fungsi baru yaitu :&nbsp; presentActionSheet(), chooseFromGallery() dan takePictureWithCamera()</span></p><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"><div style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Fungsi presentActionSheet()</span></div></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;"></span>Fungsi ini bertugas untuk menampilan Action Sheet yaitu semacam pull up menu, dan akan memanggil fungsi chooseFromGallery atau takePictureWithCamera sesuai dengan menu yang kita pilih. Fungsi ini dipanggil saat kita click/tap pada gambar contact di halaman add contact.<br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Fungsi chooseFromGallery()</span></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Sesuai dengan namanya fungsi ini berfungsi menampilkan gambar dari gallery, kemudian kita bisa memilihnya. Di dalam fungsi ini terdapat proses mengubah gambar yang dipilih menjadi string base64 yang kemudian di set ke object contact untuk nantinya disimpan ke server.</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Fungsi takePictureWithCamera()</span></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Fungsi ini akan membuka camera device anda dan kita bisa take picture. Selanjut gambar tersebut akan diubah menjadi string base64 yang nantinya akan disimpan ke server.</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Edit file add.html</span></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Agar gambar yang kita pilih dari gallery atau ambil dengan kamera bisa ditampilkan maka perlu melakukan perubahan pada file add.html sebagai berikut</div><p><br></p>', 'data:image/png;base64,', '2018-01-27 14:17:16', '2018-01-27 14:18:39', 7, 'Java, PHP, Fatfree Framework', 1, 0, 1);
INSERT INTO `tpost` (`id`, `title`, `short_content`, `full_content`, `image`, `create_date`, `publish_date`, `category_id`, `tags`, `allow_comments`, `types`, `status`) VALUES
	(8, 'Validasi Nomer Handphone di Ionic', 'Aktifasi account menggunakan nomer handphone user saat ini sudah menjadi fitur standar diaplikasi. Apalagi aplikasi yang kita buat akan menggunakan nomer handphone user sebagai ID uniq dan valid, misalnya aplikasi seperti Whatsapp. Tantangannya adalah bagaimana kita memastikan nomer handphone yang diinput user adalah sesuai dengan format yang benar? selanjutnya bagaimana kalau aplikasi kita digunakan di negara lain? kita harus bisa melakukan validasi nomer sesuai format yang benar di negara tersebut.', '<p><span style="color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Untuk kebutuhan melakukan validasi nomer handphone di aplikasi Ionic kita bisa menggunakan 2 library/plugin tambahan. Yang pertama adalah&nbsp;</span><a target="_blank" rel="nofollow" href="https://ionicframework.com/docs/native/sim/" style="box-sizing: inherit; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); touch-action: manipulation; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">ionic-native/sim</a><span style="color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">. Plugin ini berfungsi untuk mendapatkan informasi tentang SIM Card user, salah satu informasi tersebut adalah kode negara dari Sim Card user. Data ini bisa kita manfaatkan untuk melakukan validasi nomer sesuai negara asal user nantinya.</span><br></p><p><img class="img-responsive" src="data:image/png;base64," data-filename="Screenshot_2018-01-21-11-40-45-453_io.ionic.starter.png" style="width: 824px; height: 477.675px;"></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Library berikutnya yang dibutuhkan adalah&nbsp;<a target="_blank" rel="nofollow" href="https://github.com/catamphetamine/libphonenumber-js" style="box-sizing: inherit; color: rgb(0, 0, 0); touch-action: manipulation;">libphonenumber-js</a>. Library ini berfungsi untuk melakukan proses validasinya.</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Buat Ionic Project</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;"></span>Pastikan di komputer anda sudah terinstall nodejs, ionic, cordova dan android studio. Selanjutnya jalankan perintah perintah berikut ini melalui command line.</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">$ ionic start phone-validation blank</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Perintah di atas akan meng<i style="box-sizing: inherit;">create</i>&nbsp;sebuah project ionic yang baru dalam folder phone-validation. Tipe project yang digunakan adalah blank project.</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Install Plugin dan Library</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Masuk ke dalam difolder project kita</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">$ cd phone-validation</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">dan jalankan beberapa perintah berikut ini dari command line untuk menginstall ion-native/sim.</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 11.34px; margin-bottom: 1rem; color: rgb(33, 37, 41);"><code class="hljs shell" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> ionic cordova plugin add cordova-plugin-sim</span>\r\n<span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> npm install --save @ionic-native/sim</span></code></pre></pre><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Selanjutnya kita menginstall library libphonenumber-js dengan perintah</p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs shell" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-meta" style="box-sizing: inherit; color: rgb(31, 113, 153);">$</span><span class="bash" style="box-sizing: inherit;"> npm install libphonenumber-js --save</span></code></pre><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Coding Time</span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Buka project anda dengan editor kesayangan anda dan sesuaikanlah beberapa kode berikut sesuai dengan lokasi filenya masing-masing.<span style="box-sizing: inherit; font-weight: bolder;"></span></p><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">app.module.ts</span></p><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs coffeescript" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;"><span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { BrowserModule } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@angular/platform-browser\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { ErrorHandler, NgModule } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@angular/core\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { IonicApp, IonicErrorHandler, IonicModule } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'ionic-angular\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { SplashScreen } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@ionic-native/splash-screen\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { StatusBar } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@ionic-native/status-bar\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> {Sim} <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'@ionic-native/sim\'</span>;\r\n\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { MyApp } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'./app.component\'</span>;\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">import</span> { HomePage } <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">from</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'../pages/home/home\'</span>;\r\n\r\n@NgModule({\r\n  declarations: [\r\n    MyApp,\r\n    HomePage\r\n  ],\r\n  imports: [\r\n    BrowserModule,\r\n    IonicModule.forRoot(MyApp)\r\n  ],\r\n  bootstrap: [IonicApp],\r\n  entryComponents: [\r\n    MyApp,\r\n    HomePage\r\n  ],\r\n  providers: [\r\n    StatusBar,\r\n    SplashScreen,\r\n    {provide: ErrorHandler, useClass: IonicErrorHandler},\r\n    Sim\r\n  ]\r\n})\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">export</span> <span class="hljs-class" style="box-sizing: inherit;"><span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">class</span> <span class="hljs-title" style="box-sizing: inherit; color: rgb(136, 0, 0); font-weight: bold;">AppModule</span> {}</span>\r\n</code></pre><p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;"><br style="box-sizing: inherit; font-weight: 400;"><span style="font-weight: 400;">Di file app.module.ts kita mengimport plugin Sim dari ion-native/sim dan&nbsp; menambahkan plugin Sim ke bagian provider agar bisa kita gunakan plugin ini nantinya. Selanjutnya kita akan mengubah file home.html untuk mengatur layout aplikasi.</span></span></p><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><div style="box-sizing: inherit;"><br></div></div>', 'data:image/png;base64,', '2018-01-27 14:17:16', '2018-01-27 14:18:39', 8, 'Ionic Framework, Android', 1, 0, 1),
	(9, 'Berkenalan dengan Fat-Free Framework (1)', 'Pada tulisan sebelumnya saya menjelaskan opini saya tentang Framework ini. Bagaimana akhirnya saya memilih Fat-Free Framework dibanding Laravel dan CodeIgniter untuk membangun website ini kelaskoding.com. Pada tulisan kali ini kita akan mengenal lebih jauh bagaimana menggunakan Fat-Free Framework.', '<p style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Jika anda mencari framework PHP yang modern, minimalis, mudah dipelajari, cukup lengkap tetapi tidak mengorbankan performanya maka salah satu pilihannya adalah Fat-Free Framework</p><h2 style="box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; color: rgb(82, 80, 80); font-size: 2rem;">A powerful yet easy-to-use PHP micro-framework designed to help you build dynamic and robust web applications - fast!</h2><p style="box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; color: rgb(82, 80, 80); font-size: 2rem;"><img class="img-responsive" src="data:image/png;base64," data-filename="fat-free.png" style="width: 1116.42px; height: 411px;"></p><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Salah satu hal yang memudahkan kita menggunakan sebuah framework yang baru adalah karena dokumentasinya yang lengkap dan mudah dipahami. Nah ini juga merupakan salah satu kelebihan Fat-Free Framework: Dokumentasinya lengkap dan mudah dipelajari. Memang penggunanya masih sedikit, sehingga kalaupun kita googling tidak akan menemukan banyak referensi dibanding framework seperti Laravel atau CI. Akan tetapi dokumentasinya sangat lengkap dan cukup mudah dipelajari, sehingga saya yang bukan programmer PHPpun bisa dengan mudah beradaptasi. Silakan kunjungi&nbsp;<a target="_blank" rel="nofollow" href="https://fatfreeframework.com/3.6/user-guide" style="box-sizing: inherit; color: rgb(0, 0, 0); touch-action: manipulation;">dokumentasi Fat-Free Framework</a>&nbsp;untuk pelajari framework ini lebih detail, atau anda bisa mulai dari tulisan saya ini untuk mendapatkan gambaran awal.</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><span style="box-sizing: inherit; font-weight: bolder;">Instalasi</span></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Pastikan dikomputer anda sudah terinstall PHP dan Composer. Anda dapat menggunakan Wamp, XAMPP, MAMP or what ever asalkan PHPnya udah jalan mulus dikomputer anda. Yang perlu diingat Fat-Free membutuhkan PHP versi 5.4 atau yang terbaru. Fat-Free adalah framework PHP yang modern yang proses instalasinya dapat dilakukan menggunakan Composer. Untuk menginstall Fat-Free jalankan perintah berikut di folder tertentu :</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">$ composer require&nbsp;"bcosca/fatfree"</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Tunggu beberapa saat untuk menyelesaikan proses download yang dilakukan oleh composer. Jika proses download sudah selesai maka di dalam folder tersebut akan ditemukan file composer.json dan folder vendor. Di dalam folder vendor inilah kita temukan library Fat-Free framework.&nbsp;</div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br></div><div style="box-sizing: inherit; color: rgb(82, 80, 80); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><div style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Hello World</span></div><div style="box-sizing: inherit;">Di root folder aplikasi buatlah sebuah file index.php kemudian tuliskan kode program berikut&nbsp;</div><pre style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 12.6px; margin-bottom: 1rem; color: rgb(33, 37, 41); background-color: rgb(255, 255, 255);"><code class="hljs php" style="box-sizing: inherit; font-family: Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; padding: 0.5em; color: rgb(68, 68, 68); background: rgb(240, 240, 240); display: block; overflow-x: auto;">\r\n<span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">require</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'vendor/autoload.php\'</span>;\r\n$f3 = \\Base::instance();\r\n$f3-&gt;route(<span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'GET /\'</span>,\r\n    <span class="hljs-function" style="box-sizing: inherit;"><span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">function</span><span class="hljs-params" style="box-sizing: inherit;">()</span> </span>{\r\n        <span class="hljs-keyword" style="box-sizing: inherit; font-weight: bold;">echo</span> <span class="hljs-string" style="box-sizing: inherit; color: rgb(136, 0, 0);">\'Hello, world!\'</span>;\r\n    }\r\n);\r\n</code></pre>Jika folder project anda berada dalam folder httdocs dari webserver anda maka anda bisa langsung mencoba menjalankan aplikasi ini melalui browser dengan alamat (umumnya)&nbsp;<a target="_blank" rel="nofollow" href="http://localhost/namaapp" style="box-sizing: inherit; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); touch-action: manipulation;">http://localhost/namaapp</a>.&nbsp;Atau&nbsp;kalau&nbsp;anda ingin menjalan&nbsp;PHP&nbsp;dari&nbsp;command&nbsp;line anda&nbsp;bisa&nbsp;menjalankan&nbsp;perintah&nbsp;berikut<div style="box-sizing: inherit;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit;">$ php -S localhost:80 -t ./</div></div>', 'data:image/png;base64,', '2018-01-27 13:53:53', '2018-01-27 13:53:53', 7, 'Fatfree Framework, PHP', 1, 1, 1);
